function Home() {
  return (
    <div>
      <h1>This is Home Page</h1>
      <ul>
        <li>Apples</li>
        <li>Bananas</li>
        <li>Cherries</li>
      </ul>
      <p>{renderApp}</p>
  </div>
  );
}


function renderApp() {
  const welcome = "Welcome!";
}

function renderLogin() {
  const please = "Please log in";
}

let authenticated = true;

if (authenticated) {
  renderApp();
} else {
  renderLogin();
}

export default Home;
